import React from 'react';
import { IconButton } from '@mui/material';
import JVerdeSvg from '../jverde.svg';
import JVermelhoSvg from '../jvermelho.svg';

const Mapa = () => {
  //dummy, remover depois
  const getOccupationStatus = () => {
    return true;
  };

  const gridItems = Array.from({ length: 120 }, (_, index) => (
    <Grid item key={index} xs={1}>
      {getOccupationStatus() ? (
        <IconButton id={index}>
          <img src={JVerdeSvg} alt="Icon" />
        </IconButton>
      ) : (
        <IconButton id={index}>
          <img src={JVermelhoSvg} alt="Icon" />
        </IconButton>
      )}
    </Grid>
  ));

  return (
    <React.Fragment>
      <Container>
        <Grid container rowSpacing={5} columnSpacing={5}>
          {gridItems}
        </Grid>
      </Container>
    </React.Fragment>
  );
};

export default Mapa;
